	"opensap/orders/i18n/i18n.properties":'# This is the resource bundle for Browse Orders\r\n\r\n#XTIT: Application name\r\nappTitle=Browse Orders\r\n\r\n#YDES: Application description\r\nappDescription=App for displaying orders\r\n\r\n#~~~ Master View ~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Master view title with placeholder for the number of items\r\nmasterTitleCount=Orders ({0})\r\n\r\n#XTOL: Tooltip for the search field\r\nmasterSearchTooltip=Enter an order name or a part of it.\r\n\r\n#XBLI: text for a list with no data\r\nmasterListNoDataText=No orders are currently available\r\n\r\n#XBLI: text for a list with no data with filter or search\r\nmasterListNoDataWithFilterOrSearchText=No matching orders found\r\n\r\n#XSEL: Option to sort the master list by CustomerName\r\nmasterSort1=Sort By Customer\r\n\r\n#YMSG: Delete error message\r\ndeleteErrorMessage=The item couldn\'t be deleted\r\n\r\n#YMSG: Delete success message\r\ndeleteSuccessMessage=Item deleted successfully\r\n\r\n#YMSG: Delete confirmation message\r\ndeleteConfirmationMessage=Do you want to delete {0}?\r\n\r\n#XTIT: Title text for the confirmation dialog\r\nconfirmTitle=Confirm\r\n\r\n#XSEL: Option to sort the master list by NetAmount\r\nmasterSort2=Sort By Price\r\n\r\n#XSEL: Option to filter the master list by NetAmount\r\nmasterFilterName=Price\r\n\r\n#XSEL: Option to not filter the master list\r\nmasterFilterNone=none\r\n\r\n#XSEL: Option to filter the master list by CurrencyCode if the value is less than 100\r\nmasterFilter1=<100 Currency\r\n\r\n#XSEL: Option to filter the master list by CurrencyCode if the value is greater than 100\r\nmasterFilter2=>100 Currency\r\n\r\n#YMSG: Filter text that is displayed above the master list\r\nmasterFilterBarText=Filtered by {0}\r\n\r\n#XSEL: Option to not group the master list\r\nmasterGroupNone=(Not grouped)\r\n\r\n#XSEL: Option to group the master list by NetAmount\r\nmasterGroup1=Price Group\r\n\r\n#XGRP: Group header NetAmount\r\nmasterGroup1Header1=Price 20 or less\r\n\r\n#XGRP: Group header NetAmount\r\nmasterGroup1Header2=Price higher than 20\r\n\r\n#~~~ Detail View ~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTOL: Icon Tab Bar Info\r\ndetailIconTabBarInfo=Info\r\n\r\n#XTOL: Icon Tab Bar Attachments\r\ndetailIconTabBarAttachments=Attachments\r\n\r\n#XTOL: Tooltip text for close column button\r\ncloseColumn=Close\r\n\r\n#XBLI: Text for the ToLineItems table with no data\r\ndetailLineItemTableNoDataText=No Products\r\n\r\n#XTIT: Title of the ToLineItems table\r\ndetailLineItemTableHeading=Order Items\r\n\r\n#XTIT: Title of the ToLineItems table\r\ndetailLineItemTableHeadingCount=Order Items ({0})\r\n\r\n#XGRP: Title for the Quantity column in the ToLineItems table\r\ndetailLineItemTableIDQuantity=Quantity\r\n\r\n#XGRP: Title for the ProductID column in the ToLineItems table\r\ndetailLineItemTableIDColumn=ProductId\r\n\r\n#XGRP: Title for the NetAmount column in the ToLineItems table\r\ndetailLineItemTableUnitNumberColumn=Price\r\n\r\n#XGRP: Title for the DeliveryDate column in the ToLineItems table\r\ndetailLineItemTableDeliveryDate=Delivery date\r\n\r\n#XGRP: Title for the days until DeliveryDate column in the ToLineItems table\r\ndetailLineItemTableDeliveryUrgency=Delivery urgency\r\n\r\n#XTIT: Title text for the Order Preparation process\r\nOrderPreparationTitle=Order Preparations\r\n\r\n#XTIT: Confirm Order Preparation Message\r\nOrderPreparationMessage=Order {0} for {1} is prepared for shipment!\r\n\r\n#XTIT: Title text for the Pack Items Switch\r\nPackItemsTitle=1. Pack Items\r\n\r\n#XTIT: Title text for the Print Invoice Switch\r\nPrintInvoiceTitle=2. Print Invoice\r\n\r\n#XTIT: Title text for the Add Sample Switch\r\nAddSampleTitle=3. Add Sample\r\n\r\n#XBUT: Text for the Confirm order preparations button\r\nConfirmPreparations=Confirm\r\n\r\n#XBUT: Text for the Cancel button in the footer\r\nDetailFooterCancel=Cancel\r\n\r\n#XTIT: Send E-Mail subject\r\nshareSendEmailObjectSubject=<Email subject including object identifier PLEASE REPLACE ACCORDING TO YOUR USE CASE> {0}\r\n\r\n#YMSG: Send E-Mail message\r\nshareSendEmailObjectMessage=<Email body PLEASE REPLACE ACCORDING TO YOUR USE CASE> {0} (id: {1})\\r\\n{2}\r\n\r\n#XBUT: Text for the send e-mail button\r\nsendEmail=Send E-Mail\r\n\r\n#XTIT: Title text for the delivery status\r\nStatusDesc=Delivery status\r\n\r\n#XTOL: Tooltip for the create button\r\ncreateButtonTooltip=Create a new order item for this order\r\n\r\n#~~~ Create new item view ~~~~~~~~~~~~~\r\n\r\n#XTIT: Heading title of the create item page\r\ncreateItemTitle=Create New Order Item\r\n\r\n#XFLD: Text for the product name in the create item page\r\ncreateItemProductID=Product ID\r\n\r\n#XFLD: Text for item description in the create item page\r\ncreateItemDescription=Description\r\n\r\n#XFLD: Text for the quantity of each item in the create item page\r\ncreateItemQuantityDescription=Quantity\r\n\r\n#XGRP: Title of the delivery group of information in the create item dialog\r\ncreateItemDeliveryTitle=Delivery\r\n\r\n#XFLD: Text for the delivery date in the create item page\r\ncreateItemDeliveryDate=Delivery date\r\n\r\n#XGRP: Title of the details group of information in the create item page\r\ncreateItemDetailsTitle=Details\r\n\r\n#XBUT: Text for create new item button\r\ncreateItemSaveButtonText=Save\r\n\r\n#XBUT: Text for cancelling the creation of a new item button\r\ncreateItemCancelButtonText=Cancel\r\n\r\n#XMSG: Sucess message when a new item was created\r\nnewItemCreated=Order Item {0} was successfully created\r\n\r\n#~~~ Info View ~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XFLD: Text for item description of each item in the order\r\ninfoItemDescription=Item description\r\n\r\n#XFLD: Text for item description language of each item in the order\r\ninfoItemDescriptionLanguage=Language\r\n\r\n#XGRP: Title of the details group of information about each item\r\ninfoItemDetailsTitle=Details\r\n\r\n#XGRP: Title of the delivery group of information about each item\r\ninfoItemDeliveryTitle=Delivery\r\n\r\n#XFLD: Text for the gross price of each item in the order\r\ninfoItemGrossPriceDescr=Gross Price\r\n\r\n#XFLD: Text for the net price of each item in the order\r\ninfoItemNerPriceDescr=Net Price\r\n\r\n#XFLD: Text for the tax of each item in the order\r\ninfoItemTaxDescr=Tax\r\n\r\n#XFLD: Text for the quantity of each item in the order\r\ninfoItemQuantityDescr=Quantity\r\n\r\n#XFLD: Text for the delivery date of each item in the order\r\ninfoItemDeliveryDateDescr=Delivery date\r\n\r\n#~~~ Not Found View ~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Not found view title\r\nnotFoundTitle=Not Found\r\n\r\n#YMSG: The SalesOrderSet not found text is displayed when there is no SalesOrderSet with this id\r\nnoObjectFoundText=This order is not available\r\n\r\n#YMSG: The not found text is displayed when there was an error loading the resource (404 error)\r\nnotFoundText=The requested resource was not found\r\n\r\n#~~~ Not Available View ~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#XTIT: Master view title\r\nnotAvailableViewTitle=Order\r\n\r\n#~~~ Error Handling ~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n#YMSG: Error dialog description\r\nerrorText=Sorry, a technical error occurred! Please try again later.\r\n\r\n#XHED:\r\ninfoTitle=Information',
